const SearchBar = () => {

    return (
        <div className="searchbar-header">
            <nav >
                    <input type="search" placeholder="Search" aria-label="Search"></input>
                    <button class="btn btn-outline-success" type="submit">Search</button>
            </nav>
        </div>
    )
}

export default SearchBar;
